script: |
  super -f text -I q10729.spq | sort > q10729.out

inputs:
  - name: q10729.spq
    data: |
      SELECT col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col0 * col2 + + col1 AND NULL OR NULL NOT BETWEEN col0 + - col2 + col1 AND ( - col1 + col2 );
  - name: tab1

outputs:
  - name: q10729.out
    data: |
